import React from 'react'
import {  Route, Switch ,Redirect,useRouteMatch} from 'react-router-dom';
import Notes from './public/notes';
import PropTypes from 'prop-types';

import Reminders from './public/reminders';
import Labels from './public/labels';
import ModifyLabels from './public/modify-labels';
import Archive from './public/archive';
import Delete from './public/Delet';

 const RightLayout = (match) => {
   let { path, url } = useRouteMatch();
    return (

       <Switch>

       <Route exact path={`${url}/`}>
       <Redirect to={`${url}/notes`} />
   </Route>


       <Route exact path={`${url}/notes`} component={Notes}/>

       <Route exact path={`${url}/reminders`} component={Reminders}/>
       <Route exact path="/dashboard/labels" component={Labels}/>
       <Route exact path="/dashboard/archive" component={Archive}/>
       <Route exact path="/dashboard/modifyLabels" component={ModifyLabels}/>
       <Route exact path="/dashboard/delete" component={Delete}/>


       </Switch>
    )
}
RightLayout.propTypes = {
   match: PropTypes.shape({
       url: PropTypes.string.isRequired
   }).isRequired
};
export default RightLayout;
